import React, { useState } from 'react';
//import SideBar from "./components/SideBar/SideBar";
import Layout from './components/Layout/Layout';
import Header from './components/Header/Header';

const AppRoutes = [
 
  
  {
    path: 'Layout',
    element: <Layout />
  },
  {
    path: 'Header',
    element: <Header />

  },
  {
    path: 'Top',
    element: <Header />

  },

];

export default AppRoutes;
